ФортиФлора – пищевая добавка для собак, содержащая пробиотики.

Используют пищевую добавку в таких случаях:
-при дисбактериозе, в том числе и вызванном приемом антибиотиков;
-при диарее, обусловленной неправильным питанием, стрессами, знакомством с новой пищей;
-при остром энтерите;
-при метеоризме;
-при гастроэнтерите;
-при других нарушениях работы желудочно-кишечного тракта.
ФортиФлора рекомендована для щенков, которые отлучаются от материнского молока. Из-за смены питания у них может наблюдаться расстройство желудка, отсутствие аппетита и даже отказ от еды. Пищевая добавка французского производителя позволит избежать подобных проблем и поможет щенку быстро адаптироваться к новому виду питания. Давать смесь можно для профилактики появления выше описанных симптомов или для их устранения и нормализации работы кишечника.
